  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains correspondence associated
  with the cooperative agreement for the construction of a road bridge and approaches
  adjacent to the Tewaukon National Wildlife Refuge. This agreement is between the
  U.S. Department of the Interior, Fish and Wildlife Service, Bureau of Sport Fisheries
  and Wildlife and Sargent County, North Dakota.  As part of the agreement Sargent
  County is responsible for construction and maintenance of the road.  This agreement
  includes share costs and other liabilities the County agreed to.  The contract number
  for this agreement is 14-16-0003-12036.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
